import Card from "./Card";
import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  const expenses = [];
  props.expenses.forEach((expense) => {
    expenses.push(
      <ExpenseItem
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      ></ExpenseItem>
    );
  });
  return <Card className="expenses">{expenses}</Card>;
}

export default Expenses;
